-- ----------------------------
--  Table structure for `water_meter`
-- ----------------------------
DROP TABLE IF EXISTS `water_meter`;
CREATE TABLE `water_meter` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `community` int(11) DEFAULT NULL COMMENT '小区',
  `building` int(11) DEFAULT NULL COMMENT '楼宇',
  `realestate_id` int(11) NOT NULL COMMENT '房屋编号，也是水表号',
  `year` int(11) NOT NULL COMMENT '年',
  `month` int(11) NOT NULL COMMENT '月',
  `readout` int(32) DEFAULT NULL COMMENT '水表读数',
  `type` int(2) NOT NULL COMMENT '费表类型，0代表水表，1代表电表',
  `property` bigint(20) DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `realestate_id_year_month_readout_type` (`realestate_id`,`year`,`month`,`readout`,`type`),
  KEY `FK_water_meter_community_basic` (`community`),
  KEY `FK_water_meter_community_building` (`building`),
  CONSTRAINT `FK_water_meter_community_basic` FOREIGN KEY (`community`) REFERENCES `community_basic` (`community_id`),
  CONSTRAINT `FK_water_meter_community_building` FOREIGN KEY (`building`) REFERENCES `community_building` (`building_id`),
  CONSTRAINT `FK_water_meter_community_realestate` FOREIGN KEY (`realestate_id`) REFERENCES `community_realestate` (`realestate_id`)
) ENGINE=InnoDB AUTO_INCREMENT=397 DEFAULT CHARSET=utf8;

-- ----------------------------
--  View definition for `账单缴费情况`
-- ----------------------------
DROP VIEW IF EXISTS `账单缴费情况`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`%` SQL SECURITY DEFINER VIEW `账单缴费情况` AS select `user_invoice`.`invoice_id` AS `账单ID`,`community_basic`.`community_name` AS `小区名称`,`community_building`.`building_name` AS `楼宇栋号`,`community_realestate`.`room_name` AS `房屋业主编号`,`community_realestate`.`owners_name` AS `业主姓名`,`community_realestate`.`owners_cellphone` AS `业主联系方式`,`user_invoice`.`description` AS `账单说明`,`user_invoice`.`invoice_amount` AS `账单金额`,date_format(from_unixtime(`user_invoice`.`create_time`),'%Y-%m-%d %H:%i:%S') AS `账单创建时间`,`user_invoice`.`order_id` AS `网上支付订单号`,`user_invoice`.`invoice_notes` AS `备注`,date_format(from_unixtime(`user_invoice`.`payment_time`),'%Y-%m-%d %H:%i:%S') AS `付款时间`,`user_invoice`.`invoice_status` AS `账单状态`,date_format(from_unixtime(`user_invoice`.`update_time`),'%Y-%m-%d %H:%i:%S') AS `update_time` from (((`user_invoice` join `community_basic`) join `community_building`) join `community_realestate`) where ((`user_invoice`.`community_id` = `community_basic`.`community_id`) and (`user_invoice`.`building_id` = `community_building`.`building_id`) and (`user_invoice`.`realestate_id` = `community_realestate`.`realestate_id`));

